import React from 'react';
import Profil from "./Profil";
import axios from "axios";

class ProfilContainer extends React.Component {

    componentDidMount() {
        axios.get(`https://social-network.samuraijs.com/api/1.0/pro`)
            .then(resolve => {
                this.props.setUsers(resolve.data.items)
            })
    }
    render() {

        return (
            <div>
                <Profil/>
            </div>
        )
    }
}

export default ProfilContainer;
